import React from 'react'
import { Button } from 'reactstrap';
import { Container, Row, Col } from 'reactstrap';
import {HomeContainer,HomeH1,Homespan} from './HomeElements'

const Home = () => {
    return (
        <HomeContainer>
            <Col lg={{size: 7, offset: 1}}>
                <HomeH1>
                    안녕하세요, 저는<br></br> 웹개발자
                    <span className="font-color-pink">임정우</span>입니다.
                </HomeH1>
                <Button outline color="secondary">Projects</Button>{' '}
                <Button outline color="secondary">Contact</Button>{' '}
            </Col>
        </HomeContainer>
    )
}

export default Home;
